class CourseList {
    constructor(id, CourseName, Duration, startDate, EndDate, TeachingInstrList) {
        this.Id = id;
        this.CourseName = CourseName;
        this.Duration = Duration;
        this.startDate = startDate;
        this.EndDate = EndDate;
        this.TeachingInstrList = TeachingInstrList;
    }
}

export default CourseList;
